const Brewery = (props) => {
  return (
    <>
      <div id="cardLayout">
        <div id="name">
          <div id="nameText">
          <h1>{props.brewery.name}</h1>
          </div>
        </div>
        <div id="info">
          <h3>Type: {props.brewery.brewery_type}</h3><hr/>
          <h3>Address:{props.brewery.street}</h3><hr/>
          <h3>{props.brewery.city}, {props.brewery.state}</h3><hr/>
          <h3>Website: {props.brewery.website_url}</h3>
        </div>
      </div>
    </>
  );
};

export default Brewery;
